import Home from './components/home'; 
import { Route, Routes } from 'react-router-dom';
// import Private from './components/private'

function App() {
  return (
    <div>
      <Routes>
        < Route path="/" exact element={<Home/>}/>
      </Routes>
    </div>
  );
}
export default App;

